<!DOCTYPE html>
<html lang="en">
<link href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/5.15.4/css/all.min.css" rel="stylesheet" />
<link rel="icon" href="icon_planet.jpg">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Map</title>
  <style>
    body {
      height: 100%;
      margin: 0;
      display: flex;
      flex-direction: column;
      font-family: 'Poppins', sans-serif;
      overflow: hidden;
      background: linear-gradient(rgba(0, 0, 0, 0.2), rgba(0, 0, 0, 0.2)),
        url('ccchaos.svg');
      background-color: #CEE470;
      background-size: cover;
    }

    .room {
      fill: #E8E9ED;
      stroke: #AAB9C9;
      transition: fill 0.3s;
      cursor: pointer;
      stroke-width: 0.5px;
    }

    .room:hover {
      fill: #EA4335;
    }

    .shape {
      fill: #E8E9ED;
      stroke: #000;
      stroke-width: 2;
    }

    .highlight {
      stroke: #EA4335;
      stroke-width: 6;
      fill: url(#highlightGradient);
      stroke-dasharray: 12, 6;
      stroke-dashoffset: 0;
      animation: pulseWave 1s infinite, rippleEffect 1.5s infinite, blinkRed 0.3s step-end infinite;
    }

    @keyframes rippleEffect {
      0% {
        stroke-dashoffset: 0;
      }

      25% {
        stroke-dashoffset: 10;
      }

      50% {
        stroke-dashoffset: 40;
      }

      75% {
        stroke-dashoffset: 20;
      }

      100% {
        stroke-dashoffset: 0;
      }
    }

    @keyframes blinkRed {
      0% {
        fill: url(#highlightGradient);
      }

      50% {
        fill: #FF0000;
      }

      100% {
        fill: url(#highlightGradient);
      }
    }

    svg {
      width: 100%;
      height: calc(100vh - 60px);
      max-height: 100%;
      cursor: default;
      transition: transform 0.2s;
      margin-top: 100px;
    }

    #profileCard.hidden {
      display: none;
    }

    #profileCard {
      position: fixed;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      background-color: #fff;
      padding: 20px;
      width: 280px;
      height: auto;
      border-radius: 24px;
      box-shadow: 0 6px 12px rgba(0, 0, 0, 0.1);
      border: 2px solid #4C3491;
      font-family: Arial, sans-serif;
    }

    #profileCard h3 {
      text-align: center;
      color: #F44336;
      font-size: 20px;
      font-weight: bold;
    }

    #profileCard p {
      margin: 10px 0;
      font-size: 14px;
      color: #333;
    }

    #profileCard p strong {
      color: #4C3491;
      font-weight: 600;
    }

    .profile-photo {
      width: 100px;
      height: 100px;
      border-radius: 50%;
      margin: 19px auto;
      border: 2px solid #4C3491;
      display: flex;
      justify-content: center;
      align-items: center;
      background-color: #f1f1f1;
    }

    .profile-photo img {
      width: 100%;
      height: 100%;
      border-radius: 50%;
      object-fit: cover;
    }

    #profileCard .profile-details {
      display: flex;
      justify-content: space-between;
      font-size: 14px;
    }

    #profileCard .profile-details span {
      font-weight: normal;
    }

    #profileButtonsContainer {
      display: flex;
      justify-content: space-between;
      margin-top: 20px;
    }

    #profileButtonsContainer button {
      flex: 1;
      margin: 0 5px;
      padding: 0px;
      border: none;
      font-size: 14px;
      font-weight: bold;
      height: 35px;
      cursor: pointer;
      color: white;
      border-radius: 8px;
    }

    #contactStudentButton {
      background: #6D4AD0;
    }

    #contactGuardianButton {
      background: #F34336;
    }

    #closeProfile {
      position: absolute;
      top: 8px;
      right: 8px;
      background: none;
      border: none;
      color: #333;
      font-size: 20px;
      cursor: pointer;
    }

    #closeProfile:hover {
      color: #f44336;
    }

    #buttonsContainer {
      position: fixed;
      bottom: 0;
      left: 50%;
      transform: translateX(-50%);
      display: flex;
      justify-content: space-between;
      align-items: center;
      width: 100%;
      max-width: 290px;
      padding: 10px 20px;
      background-color: #6D4AD0;
      border-radius: 65px 65px 0 0;
    }

    #buttonsContainer button {
      margin: 0px 3px;
      padding: 10px;
      font-size: 14px;
      font-weight: bold;
      color: white;
      border: none;
      cursor: pointer;
      transition: transform 0.3s ease, background-color 0.3s ease;
      display: flex;
      justify-content: center;
      align-items: center;
    }

    #callMobileButton {
      background: linear-gradient(135deg, #f44336, #d32f2f);
      width: 100px;
      height: 42px;
      border-radius: 82px 20px 8px 8px;
      width: 120px;
    }

    #callMobileButton:hover {
      background: linear-gradient(135deg, #e53935, #b71c1c);

    }

    #profileButton {
      background-color: #4C3491;
      height: 42px;
      width: 42px;
      border-radius: 50%;
      display: flex;
      justify-content: center;
      align-items: center;
      padding: 0;
    }

    #profileButton i {
      font-size: 18px;

    }

    #callEmergencyButton {
      background: linear-gradient(135deg, #4caf50, #388e3c);
      width: 100px;
      height: 42px;
      border-radius: 20px 82px 8px 8px;
      width: 120px;

    }

    #callEmergencyButton:hover {
      background: linear-gradient(135deg, #45a049, #2e7d32);
    }
  </style>
</head>

<body>

  <div id="buttonsContainer">
    <button id="callMobileButton">Call 911</button>
    <button id="profileButton"><i class="fa fa-user"></i></i></i></button>
    <button id="callEmergencyButton">Log</button>
  </div>

  <div id="profileCard" class="hidden">
    <h3>Student Profile</h3>
    <div class="profile-photo"></div>
    <p><strong>Name:</strong> <span id="profileName"></span></p>
    <p><strong>Year & Section:</strong> <span id="profileYear"></span> - <span id="profileSection"></span></p>
    <p><strong>Program:</strong> <span id="profileProgram"></span></p>
    <p><strong>Mobile Number:</strong> <span id="profileMobileNo"></span></p>
    <p><strong>Emergency Contact:</strong> <span id="profileEmergencyName"></span></p>
    <p><strong>Emergency Number:</strong> <span id="profileEmergencyNo"></span></p>
    <div id="profileButtonsContainer">
      <button id="contactStudentButton">Contact Student</button>
      <button id="contactGuardianButton">Contact Guardian</button>
    </div>
    <button id="closeProfile"><i class="fa fa-times"></i></button>
  </div>

  <script>

    const profileButton = document.getElementById("profileButton");
    const profileCard = document.getElementById("profileCard");
    const urlParams = new URLSearchParams(window.location.search);
    const alertLat = parseFloat(urlParams.get("alertLat"));
    const alertLng = parseFloat(urlParams.get("alertLng"));
    const emergencyNo = urlParams.get("emergencyNo");
    const mobileNo = urlParams.get("mobileNo");
    const rooms = document.querySelectorAll(".room");
    const fullName = urlParams.get("fullName");
    const year = urlParams.get("year");
    const section = urlParams.get("section");
    const program = urlParams.get("program");
    const emergencyName = urlParams.get("emergencyName");
    const emergencyType = urlParams.get("emergencyType");
    const userName = urlParams.get('userName');
    const userLat = parseFloat(urlParams.get("userLat"));
    const userLng = parseFloat(urlParams.get("userLng"));

    document.getElementById("callEmergencyButton").addEventListener("click", function () {
      const url = `emergencylog.html?emergencyNo=${encodeURIComponent(emergencyNo)}&mobileNo=${encodeURIComponent(mobileNo)}&fullName=${encodeURIComponent(fullName)}&year=${encodeURIComponent(year)}&section=${encodeURIComponent(section)}&program=${encodeURIComponent(program)}&emergencyName=${encodeURIComponent(emergencyName)}&emergencyType=${encodeURIComponent(emergencyType)}&userName=${encodeURIComponent(userName)}`;
      window.location.href = url;
    });

    profileButton.addEventListener('click', function () {
      document.getElementById("profileName").textContent = fullName;
      document.getElementById("profileYear").textContent = year;
      document.getElementById("profileSection").textContent = section;
      document.getElementById("profileProgram").textContent = program;
      document.getElementById("profileEmergencyName").textContent = emergencyName;
      document.getElementById("profileEmergencyNo").textContent = emergencyNo;
      document.getElementById("profileMobileNo").textContent = mobileNo;

      const profilePhoto = document.querySelector(".profile-photo");
      const img = document.createElement("img");
      img.src = 'icon.jpg';
      profilePhoto.innerHTML = '';
      profilePhoto.appendChild(img);

      profileCard.classList.remove("hidden");
    });
    document.getElementById("closeProfile").addEventListener("click", function () {
      profileCard.classList.add("hidden");
    });

    contactStudentButton.addEventListener("click", () => {
      if (mobileNo) {
        window.location.href = `tel:${mobileNo}`;
      } else {
        alert("Mobile number is not available.");
      }
    });

    contactGuardianButton.addEventListener("click", () => {
      if (emergencyNo) {
        window.location.href = `tel:${emergencyNo}`;
      } else {
        alert("Emergency number is not available.");
      }
    });

    document.getElementById('callMobileButton').addEventListener('click', () => {
      const confirmCall = confirm('This action will attempt to call 911. Do you wish to proceed?');
      if (confirmCall) {
        window.location.href = 'tel:911';
      }
    });

    function haversineDistance(lat1, lng1, lat2, lng2) {
      const toRadians = (deg) => (deg * Math.PI) / 180;
      const R = 6371;
      const dLat = toRadians(lat2 - lat1);
      const dLng = toRadians(lng2 - lng1);
      const a =
        Math.sin(dLat / 2) * Math.sin(dLat / 2) +
        Math.cos(toRadians(lat1)) *
        Math.cos(toRadians(lat2)) *
        Math.sin(dLng / 2) *
        Math.sin(dLng / 2);
      const c = 2 * Math.atan2(Math.sqrt(a), Math.sqrt(1 - a));
      return R * c;
    }

    function heuristic(roomLat, roomLng, targetLat, targetLng) {
      return haversineDistance(roomLat, roomLng, targetLat, targetLng);
    }

    function aStarAlert(lat, lng) {
      const openSet = [];
      const cameFrom = {};
      const gScore = {};
      const fScore = {};

      rooms.forEach((room) => {
        const roomLat = parseFloat(room.dataset.lat);
        const roomLng = parseFloat(room.dataset.lng);
        gScore[room.dataset.name] = Infinity;
        fScore[room.dataset.name] = Infinity;
      });

      const startRoom = {
        name: "Alert Location",
        lat: alertLat,
        lng: alertLng,
      };

      gScore["Alert Location"] = 0;
      fScore["Alert Location"] = heuristic(startRoom.lat, startRoom.lng, alertLat, alertLng);

      openSet.push(startRoom);

      while (openSet.length > 0) {
        const currentRoom = openSet.reduce((a, b) => (fScore[a.name] < fScore[b.name] ? a : b));
        openSet.splice(openSet.indexOf(currentRoom), 1);

        rooms.forEach((room) => {
          const roomLat = parseFloat(room.dataset.lat);
          const roomLng = parseFloat(room.dataset.lng);
          const distance = haversineDistance(currentRoom.lat, currentRoom.lng, roomLat, roomLng);
          const newGScore = gScore[currentRoom.name] + distance;

          if (newGScore < gScore[room.dataset.name]) {
            cameFrom[room.dataset.name] = currentRoom.name;
            gScore[room.dataset.name] = newGScore;
            fScore[room.dataset.name] = gScore[room.dataset.name] + heuristic(roomLat, roomLng, alertLat, alertLng);
            openSet.push({ name: room.dataset.name, lat: roomLat, lng: roomLng });
          }
        });
      }

      let nearestRoom = null;
      let minDistance = Infinity;

      rooms.forEach((room) => {
        const roomLat = parseFloat(room.dataset.lat);
        const roomLng = parseFloat(room.dataset.lng);
        const distance = haversineDistance(alertLat, alertLng, roomLat, roomLng);

        if (distance < minDistance) {
          minDistance = distance;
          nearestRoom = room;
        }
      });

      return nearestRoom;
    }

    const nearestRoom = aStarAlert(alertLat, alertLng);

    if (nearestRoom) {
      nearestRoom.classList.add("highlight");
    }

  </script>
